CREATE TABLE "COMPARATOR"
(
    "ID" SERIAL PRIMARY KEY,
    "Product (WPN)" VARCHAR(512),
    "Datasheet" VARCHAR(512),
    "OPN" VARCHAR(512),
    "Price" FLOAT,
    "Description" VARCHAR(512),
    "tres Typ (ns)" FLOAT,
    "VCC Min (V)" FLOAT,
    "VCC Max (V)" FLOAT,
    "VIO Max (mV)" FLOAT,
    "ICC Typ (mA)" FLOAT,
    "Number of Channels" INT,
    "Package Type" VARCHAR(512),
    "IO Typ (mA)" FLOAT,
    "TA Min (°C)" INT,
    "TA Max (°C)" INT,
    "Qualification" VARCHAR(512),
    "AEC Qualified" BOOLEAN,
    "PPAP Capable" BOOLEAN,
    "Halide Free" BOOLEAN,
    "Lead Free" BOOLEAN,
    "Status" VARCHAR(512)
);

